description:
Mary Burzlaff Bostic, &quot;2014 Photographer's Market: How to Sell Your Photography and Make a Living, 37th Edition&quot;

ISBN: 1440329427 | 2013 | EPUB | 688 pages | 3 MB

The Successful Photographer's Secret! Thousands of successful photographers have trusted Photographer's Market as a resource for growing their businesses. This edition contains the most comprehensive and up-to-date market contacts for working photographers today: magazines, book publishers, greeting card companies, stock agencies, advertising firms, contests and more. In addition to the more than 1,500 individually verified contacts, 2014 Photographer's Market includes: *A FREE 1-year subscription to ArtistsMarketOnline.com, where you can search industry contacts, track your submissions, get the latest photography news and much more (PLEASE NOTE: Free subscriptions are NOT included with the e-book edition of this title.).
